import styled from 'styled-components'

const Container =  styled.div`
height:30px;
background-color: teal;
color:white;
display:flex;
align-items: center;
just-content:center;
font-size:14px;
font-weight: 500;
`

function Announcement() {
    return (
        
           <Container>
               Super Deal! Free Shipping on Orders Over $70
               </Container> 
        
    )
}

export default Announcement
